import React from "react";
import { Text, View } from "react-native";
import MyTabs from "../../components/navBar/NavBar";
import styles from "./styles";
import { StatusBar } from 'expo-status-bar';


const Menu = () =>{
    return(
        <View style={styles.container}>
            <MyTabs/>
            <StatusBar/>
        </View>
    )

}

export default Menu
